INSERT INTO dbo.Book VALUES (N'29504619', 135000, N'Các phương pháp phân tích hóa học', null, null, N'https://salt.tikicdn.com/cache/280x280/ts/product/6c/20/b0/67f7eb0176c07fb107c0a1e5ae19e3bd.jpg', null, N'Các phương pháp phân tích hóa học (Tác giả: Phạm Luận)\nHóa học phân tích là một ngành khoa học công cụ có sự tích hợp cao của các lĩnh vực khoa học tự nhiên, nó gồm có hai nhóm các phương pháp phân.', null, null, null)
INSERT INTO dbo.Book VALUES (N'70819839', 135000, N'Thiết kế và chế tạo khuôn dập', null, null, N'https://salt.tikicdn.com/cache/280x280/ts/product/18/5e/77/f745fb06afcf794d006663e54a50f6b7.jpg', null, N'Thiết kế và chế tạo khuôn dập (Tác giả: Lê Trung Kiên). Tái bản năm 2020; Khổ 16x24 cm\nCuốn sách được biên soạn nhằm giới thiệu những kiến thức cơ bản về thiết kế quy trình công nghệ, kết cấu và công.', null, null, null)
INSERT INTO dbo.Book VALUES (N'29440422', 135000, N'Thực Hành Kỹ Thuật Cơ Điện Lạnh', null, null, N'https://salt.tikicdn.com/cache/280x280/ts/product/d3/50/e1/27ff0f14feae1646db175f4abd3becc9.jpg', null, N'Thực Hành Kỹ Thuật Cơ Điện Lạnh\r\nNội dung chủ yếu của sách trình bày các vấn đề cơ bản về hệ thống lạnh và điều hòa không khí, các phương pháp bảo trì, sửa chữa, lắp đặt hệ thống lạnh, từ tủ lạnh gia..', null, null, null)
INSERT INTO dbo.Book VALUES (N'23134388', 135000, N'Hướng Dẫn Thiết Kế Cung Cấp Điện', null, null, N'"https://salt.tikicdn.com/cache/280x280/ts/product/a9/ab/02/da93d9195a9484e959ba1623b6e13743.jpg', null, N'Hướng dẫn thiết kế cung cấp điệnXác định tâm phụ tải tính toán, thiết kế chiếu sáng, phụ tải tính toán toàn nhà máy, chọn máy biến áp cho nhà máy, chọn dây dẫn và thiết bị bảo vệ,', null, null, null)
INSERT INTO dbo.Book VALUES (N'17887017', 135000, N'Đô Thị Thông Minh, Tương Lai Xán Lạn: Bản Trình Diễn Về Tương Lai', null, null, N'https://salt.tikicdn.com/cache/280x280/ts/product/75/5f/e1/138a856c9bbd07cf1fa506f70dbfa09f.jpg', null, N'Trong vòng 20 năm tới, 70% dân số thế giới sẽ sống trong các đô thị. Những thay đổi theo cấp số mũ sẽ làm ta choáng váng. Công cuộc thiết kế và vận hành những đô thị thông minh hơn không chỉ là một..', null, null, null)
INSERT INTO dbo.Book VALUES (N'23549246', 135000, N'Khoa Học Khám Phá - Mật Mã - Từ Cổ Điển Đến Lượng Tử (Tái Bản', null, null, N'https://salt.tikicdn.com/cache/280x280/ts/product/62/e6/40/9e6ca1624f11abdd423ace5743ea4738.jpg', null, N'Sách phác hoạ sự tiến hoá của mật mã từ khi nó xuất hiện cho tới nay và đồng thời là những chứng minh về sự hợp thời của nó.\n“Trong hàng ngàn năm, vua chúa cũng như các tướng lĩnh đều dựa vào mạng.', null, null, null)
